import "./DesktopNavigation.css";
import logotype from "../../../utils/images/logotype.svg";
import { useHistory } from "react-router-dom";
import { useContext } from "react";
import { UserContext } from "../../../utils/provider/UserProvider";

export const DesktopNavigation = () => {
    const history = useHistory();
    const [authUser, setAuthUser] = useContext(UserContext);

    return (
        <div className="desktopNavigationWrapper">
            <img className="navigationLogotype" src={logotype}
            alt={''}/>
            <span className="home" onClick={() => history.push('/home')}>Home</span>
            <span className="brands" onClick = {() => history.push('/brands')}>Brands</span>
            <span className="products" onClick = {() => history.push('/products')}>Products</span>
            <span className="guideline" onClick = {() => history.push('/guideline')}>Guideline</span>
            <span className="signin" onClick = {() => history.push('./signin')}>Sign in</span>
            <span>{authUser.username}</span>
        </div>

    );
}
